  return (
    <div  style={{backgroundImage: `url(${image})`,height:'100vh',

    fontSize:'50px',
    backgroundSize: 'cover',
    backgroundRepeat : 'repeat'}}>
    <Global
        styles={css`
          body {
            margin: 0;
          }
        `}
      />
    </div>
  );
}

export default App;
